import React from "react";
export const ItemListContainer = () => {
    return(
        <div className="ItemListContainerStyle">
            <div className="titleStyle">
            <h1>Products</h1>
            </div>
            <div className="prodStyle">
            <p>This is a List of the stock Available</p>
            </div>
        </div>
    )
}
